  letterSpacing: '5px',
  marginLeft: '25vw'  
};

const subheaderStyle = {
  color: 'white'
};


const App = () => {
  return (
    <div className="App">
      <header className="App-header">
        {/* <img src={logo} className="App-logo" alt="logo" /> */}
