          <img src={portrait} className="portrait" alt="Portrait of Josephine Lo" />
        </div>
        <Button>Click Me!</Button>
        <h2 style={subheaderStyle}>
          About Me
        </h2>

        <h2 style={subheaderStyle}>
          Projects
        </h2>

        <h2 style={subheaderStyle}>
          Experience
        </h2>




        {/* <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a> */}
      </header>
    </div>
  );
}

export default App;
